import React from 'react';
import CardList from './CardList';
import EvolutionChain from './EvolutionChain';
import NavButtons from './NavButtons';

const PokemonLists = ({ displayEvolution, pokemonList, onItemClick }) => {
    if (displayEvolution) {
        return <EvolutionChain pokemonList={pokemonList} onItemClick={onItemClick}/>
    }
    return (
        <>
            <CardList pokemonList={pokemonList} onItemClick={onItemClick}/>
            <NavButtons />
        </>
    )
}

export default PokemonLists;
